[nom-projet] &gt; Class1.cs &gt; Clic droit &gt; Renommer &gt; cClass.cs
...</pre><br><span class="GText2" style="
color: #00ff00;
">// Visual Studio (Formater le code source)</span><br><pre class="GCode1 Code1 AceCode" data-mode="text" data-theme="gruvbox" data-bg-color="transparent" style="background-color: transparent;">...
# Formater le code source
Touche (Ctrl + K + D)
...</pre><br><span class="GText2" style="
color: #00ff00;
">// Program.cs (Programme principal)</span><br><pre class="GCode1 Code1 AceCode" data-mode="csharp" data-theme="gruvbox" data-bg-color="transparent" style="background-color: transparent;">...
