color: #00ff00;
">// cClass.cs (Gestion de la classe)</span><br><pre class="GCode1 Code1 AceCode" data-mode="csharp" data-theme="gruvbox" data-bg-color="transparent" style="background-color: transparent;">...
namespace rdv_csharp
{
    internal class cClass
    {
        public cClass()
        {
            Console.WriteLine("Constructeur...: cClass()");

        }

        ~cClass()
        {
            Console.WriteLine("Destructeur...: ~cClass()");
        }

        public void run()
        {
            Console.WriteLine("Méthode...: cClass.run()");
        }
    }
}
...</pre><br><div class="GImg1 Img1"><img alt="image.png" src="data:image/png;base64,"></div><br><b>Notes :</b><br><br><div class="GBullet1 Bullet1">
<i class="Bullet2 fa fa-check-square-o"></i>
<div class="Bullet3">Le destructeur de la classe en C# ne peut pas être appelé directement à partir du code. Il est appelé implicitement par le Common Language Runtime (CLR) lorsque le Garbage Collector (GC) récupère l'objet.</div>
</div><br></div>
</div>
</div>
</div><br><div class="GSection1 Section1">
<div class="Section2">
<div class="Section3">
<h1 class="Section4">
<a class="Section5" href="#" id="passer-un-argument-par-reference-console">Passer un argument par référence</a>
</h1>
<div class="Section6"><br><span class="GText2" style="
color: #00ff00;
">// MainWindow.cs (Programme principal)</span><br><pre class="GCode1 Code1 AceCode" data-mode="csharp" data-theme="gruvbox" data-bg-color="transparent" style="background-color: transparent;">...
namespace rdv_csharp
{
    public partial class MainWindow : Form
    {
        public MainWindow()
        {
            InitializeComponent();
        }

        private void MainWindow_FormClosed(object sender, 
        FormClosedEventArgs e)
        {
            Application.Exit();
        }

        private void btnRun_Click(object sender, EventArgs e)
        {
            String oRef = "Bonjour ";
            String oOut = "Bonjour ";
            cClass oClass = new cClass();
            oClass.run(ref oRef, out oOut);
            Console.WriteLine("oRef : {0}", oRef);
            Console.WriteLine("oOut : {0}", oOut);
        }
    }
}
...</pre><br><span class="GText2" style="
color: #00ff00;
">// cClass.cs (Gestion du passage d'argument par référence)</span><br><pre class="GCode1 Code1 AceCode" data-mode="csharp" data-theme="gruvbox" data-bg-color="transparent" style="background-color: transparent;">...
namespace rdv_csharp
{
    internal class cClass
    {
        public cClass()
        {
        }

        public void run(ref String _ref, out String _out)
        {
            _ref += "REF";
            _out = "Bonjour OUT";
        }
    }
}
...</pre><br><div class="GImg1 Img1"><img alt="image.png" src="data:image/png;base64,"></div><br><div class="GBullet1 Bullet1">
<i class="Bullet2 fa fa-check-square-o"></i>
<div class="Bullet3">Une variable passer en argument par référence avec l'instruction (ref) est accessible en lecture et en écriture à l'intérieur de la méthode appelante.</div>
</div>
<div class="GBullet1 Bullet1">
<i class="Bullet2 fa fa-check-square-o"></i>
<div class="Bullet3">Une variable passer en argument par référence avec l'instruction (out) est accessible uniquement en écriture à l'intérieur de la méthode appelante. Et elle doit être obligatoirement initialisée à l'intérieure de la méthode appelante.</div>
</div><br></div>
</div>
</div>
</div><br><div class="GSection1 Section1">
<div class="Section2">
<div class="Section3">
<h1 class="Section4">
<a class="Section5" href="#" id="capturer-une-exception-console">Capturer une exception</a>
</h1>
<div class="Section6"><br><span class="GText2" style="
color: #00ff00;
">// MainWindow.cs (Programme principal)</span><br><pre class="GCode1 Code1 AceCode" data-mode="csharp" data-theme="gruvbox" data-bg-color="transparent" style="background-color: transparent;">...
namespace rdv_csharp
{
    internal class Program
    {
        static void Main(string[] args)
        {
            try
            {
                int[] oNumbers = { 1, 2, 3 };
                Console.WriteLine(oNumbers[10]);
            }
            catch (Exception ex)
            {
                Console.WriteLine("Erreur lors de l'accès au tableau.
                |error ={0}", ex.Message);
            }
        }
    }
}
...</pre><br><div class="GImg1 Img1"><img alt="image.png" src="data:image/png;base64,"></div><br><span class="GText2" style="
color: #00ff00;
">// Program.cs (Programme principal)</span><br><pre class="GCode1 Code1 AceCode" data-mode="csharp" data-theme="gruvbox" data-bg-color="transparent" style="background-color: transparent;">...
namespace rdv_csharp
{
    internal class Program
    {
        static void Main(string[] args)
        {
            try
            {
                int oNumber1 = 3000;
                int oNumber2 = 0;
                Console.WriteLine(oNumber1 / oNumber2);
            }
            catch (Exception ex)
            {
                Console.WriteLine("Erreur lors de la division par 0.
                |error ={0} ", ex.Message);
            }
        }
    }
}
...</pre><br><div class="GImg1 Img1"><img alt="image.png" src="data:image/png;base64,"></div><br></div>
</div>
</div>
</div><br><div class="GSection1 Section1">
<div class="Section2">
<div class="Section3">
<h1 class="Section4">
<a class="Section5" href="#" id="lever-une-exception-console">Lever une exception</a>
</h1>
<div class="Section6"><br><span class="GText2" style="
color: #00ff00;
">// Program.cs (Programme principal)</span><br><pre class="GCode1 Code1 AceCode" data-mode="csharp" data-theme="gruvbox" data-bg-color="transparent" style="background-color: transparent;">...
namespace rdv_csharp
{
    internal class Program
    {
        static void Main(string[] args)
        {
            try
            {
                Boolean isSqlConnectionError = true;

                if (isSqlConnectionError)
                {
                    throw new InvalidOperationException("Le gestionnaire de 
                    la base de données est invalide.");
                }
            }
            catch (Exception ex)
            {
                Console.WriteLine("Erreur lors de la connexion au serveur de 
                données.|error={0}", ex.Message);
            }
        }
    }
}
...</pre><br><div class="GImg1 Img1"><img alt="image.png" src="data:image/png;base64,"></div><br></div>
