<h1 class="Section4">
<a class="Section5" href="#" id="travailler-avec-sqlconnection">### Travailler avec SqlConnection</a>
</h1>
<div class="Section6"><br><b>SqlConnection </b>est un fournisseur de connexion à une base de données SQL Server en C#.
<br><br></div>
</div>
</div>
</div><br><div class="GSection1 Section1">
<div class="Section2">
<div class="Section3">
<h1 class="Section4">
<a class="Section5" href="#" id="se-connecter-a-une-base-de-donnees-sql-connection">Se connecter à une base de données</a>
</h1>
<div class="Section6"><br><b>SQL Server Management Studio (SSMS) </b>est un outil de gestion de bases de données SQL Server.
<br><br><span class="GText2" style="
color: #00ff00;
">// Windows (Ouvrir l'outil SQL Server Management Studio)</span><br><pre class="GCode1 Code1 AceCode" data-mode="text" data-theme="gruvbox" data-bg-color="transparent" style="background-color: transparent;">...
# Démarrer SQL Server Management Studio (en mode administrateur)
Bouton Windows &gt; Ouvrir l'outil SQL Server Management Studio 20 &gt; Clic droit 
&gt; Exécuter en tant qu'administrateur &gt; Oui
# Démarrer la connexion à SQL Server
Type de seveur &gt; Moteur de base de données
Nom du serveur &gt; [nom-serveur]
Authentification &gt; Authentification Windows
Chiffrement &gt; Obligatoire
Cocher &gt; Certificat de serveur de confiance
Connexion
...</pre><br><span class="GText2" style="
color: #00ff00;
">// SSMS (Charger un fichier de données MDF)</span><br><pre class="GCode1 Code1 AceCode" data-mode="text" data-theme="gruvbox" data-bg-color="transparent" style="background-color: transparent;">...
# Ouvrir le menu Attacher des bases de données
[nom-serveur] &gt; Base de données &gt; Clic droit &gt; Joindre
# Charger le fichier de données MDF
Ajouter &gt; [nom-base-donnees.mdf] &gt; OK
OK
...</pre><br><span class="GText2" style="
color: #00ff00;
">// SSMS (Renommer une base de données)</span><br><pre class="GCode1 Code1 AceCode" data-mode="text" data-theme="gruvbox" data-bg-color="transparent" style="background-color: transparent;">...
# Renommer la base de données
[nom-serveur] &gt; Base de données &gt; [nom-base-donnees] &gt; Clic droit &gt; Renommer
[nom-base-donnees-new] &gt; Touche (Entrée)
...</pre><br><div class="GImg1 Img1"><img alt="image.png" src="data:image/png;base64,"></div><br><span class="GText2" style="
color: #00ff00;
">// Program.cs (Programme principal)</span><br><pre class="GCode1 Code1 AceCode" data-mode="csharp" data-theme="gruvbox" data-bg-color="transparent" style="background-color: transparent;">...
namespace rdv_csharp
{
    internal class Program
    {
        static void Main(string[] args)
        {
            cSqlConnection oCon = null;
            cSqlConnectionOpen oOpenConn = new cSqlConnectionOpen(@"data source=&lt;nom-serveur&gt;;initial catalog=&lt;nom-base-donnees&gt;;trusted_connection=true");

            if (oOpenConn.run(ref oCon))
            {
                return;
            }
        }
    }
}
