namespace rdv_csharp
{
    internal class cSqlConnectionOpen
    {
        String m_oConString;

        public cSqlConnectionOpen(String _oConString)
        {
            m_oConString = _oConString;
        }

        public Boolean run(ref cSqlConnection _oCon)
        {
            SqlConnection oCon = new SqlConnection(m_oConString);
            try
            {
                oCon.Open();
                _oCon = new cSqlConnection(oCon);
                Console.WriteLine("La connexion au serveur de données a réussi.");
            }
            catch (Exception ex)
            {
                Console.WriteLine("Erreur lors de la connexion au serveur de données." +
                    "|conString={0}"+
                    "|error={1}", m_oConString, ex.Message);
                return false;
            }
            return true;
        }
    }
}
