namespace rdv_csharp
{
    public partial class MainWindow : Form
    {
        private int m_tmrCounter = 0;

        public MainWindow()
        {
            InitializeComponent();
        }

        private void MainWindow_FormClosed(object sender, 
        FormClosedEventArgs e)
        {
            Application.Exit();
        }

        private void btnRun_Click(object sender, EventArgs e)
        {
            tmrCounter.Enabled = !tmrCounter.Enabled;
            if (!tmrCounter.Enabled)
            {
                m_tmrCounter = 0;
            }
        }

        private void tmrCounter_Tick(object sender, EventArgs e)
        {
            m_tmrCounter++;
            Console.WriteLine("tmrCounter_Tick...: {0} ms", m_tmrCounter * tmrCounter.Interval);
        }
