namespace rdv_csharp
{
    public partial class MainWindow : Form
    {
        private int m_cmbCount;
        private int m_cmbSelect;

        public MainWindow()
        {
            InitializeComponent();
        }

        private void MainWindow_FormClosed(object sender,
        FormClosedEventArgs e)
        {
            Application.Exit();
        }

        private void MainWindow_Load(object sender, EventArgs e)
        {
            btnClear_Click(sender, e);
        }

        private void btnRun_Click(object sender, EventArgs e)
        {
            Console.WriteLine("cmbItems.Items.Count...: {0}", 
            cmbItems.Items.Count);
            Console.WriteLine("cmbItems.Text...: {0}", cmbItems.Text);
            Console.WriteLine("cmbItems.SelectedIndex...: {0}", 
            cmbItems.SelectedIndex);
        }

        private void btnClear_Click(object sender, EventArgs e)
        {
            cmbItems.Items.Clear();
            cmbItems.Items.Add("Sélectionner un élément...");
            cmbItems.SelectedIndex = 0;
            m_cmbCount = 0;
            m_cmbSelect = 0;
        }

        private void btnAdd_Click(object sender, EventArgs e)
        {
            cmbItems.Items.Add(String.Format("Element {0}", ++m_cmbCount));
            cmbItems.SelectedIndex = cmbItems.Items.Count - 1;
        }

        private void btnSelect_Click(object sender, EventArgs e)
        {
            if (++m_cmbSelect &gt;= cmbItems.Items.Count)
            {
                m_cmbSelect = 1;
            }
            cmbItems.SelectedIndex = m_cmbSelect;
        }

        private void btnRemove_Click(object sender, EventArgs e)
        {
            if(cmbItems.SelectedIndex == 0)
            {
                MessageBox.Show("Aucun élément n'a été sélectionné.");
                return;
            }

            cmbItems.Items.RemoveAt(cmbItems.SelectedIndex);
            cmbItems.SelectedIndex = 0;
        }
    }
}
